import React from 'react';

export default function ModalOrders(props) {

    const {customer} = props;
    console.log(props)
    const ordersData = () => {
        return (
            <div>{customer.orders}</div>
        )
    }

    return (
        <div>
            <h5>Toutes les commandes</h5>
            {ordersData}
        </div>
    )
}
